-- Lookup table used strictly for random selection.
local map_lookup_table = {
  [1] = "Kanto",
  [2] = "Johto",
  [3] = "Hoenn",
  [4] = "Sinnoh",
  [5] = "Unova",
  [6] = "Kalos",
  [7] = "Alola",
  [8] = "Galar",
  [9] = "Paldea",
  [10] = "Orange Islands",
}

function set_map_image_only(map_name)
  -- Check if Random was chosen.
  if map_name == "Random" then
    while true do
      map_name = map_lookup_table[math.random(1, #map_lookup_table)]
      if map_name and map_data[map_name] and map_data[map_name].map_url then
        break
      end
    end
  end

  -- Get the data for this map.
  local selected_map_data = map_data[map_name]
  if not selected_map_data then
    printToAll("Unrecognized map option: " .. tostring(map_name), "Red")
    return nil
  end

  -- Get the map URL.
  local map_url = selected_map_data.map_url
  if not map_url then
    printToAll("Map " .. tostring(map_name) "has not been implemented yet.", "Orange")
    return map_name
  end

  -- Change the map to the selected map's URL.
  printToAll("Loading " .. map_name .. " map..")
  Tables.setCustomURL(map_url)
  printToAll(map_name .. " loaded")

  -- The hands get reset each time you reload the table so fix that here. But wait 2 seconds before trying.
  Wait.time(function() Global.call("reinitialize_hand_zones", hand_zone_params) end, 2)

  return map_name
end

function get_map_data_for_region(map_name)
  return map_data[map_name]
end

-- Helper function to print a table.
function dump_table(o)
  if type(o) == 'table' then
      local s = '{ '
      for k,v in pairs(o) do
        if type(k) ~= 'number' then k = '"'..k..'"' end
        s = s .. '['..k..'] = ' .. dump_table(v) .. ','
      end
      return s .. '} '
  else
      return tostring(o)
  end
end